import React, { Component } from "react";

class SearchMovies extends Component {
  render() {
    return (
      <div>
        <h2>Search Movies</h2>

        <img src="/images/delete.jpg" alt="Delete"></img>
      </div>
    );
  }
}

export default SearchMovies;
